import{_ as o,o as a,c as t,z as e,a as n}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 29.1-542 Importation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/29.1-542.md","filePath":"vacode/29.1-542.md"}'),s={name:"vacode/29.1-542.md"},i=e("h1",{id:"§-29-1-542-importation",tabindex:"-1"},[n("§ 29.1-542 Importation. "),e("a",{class:"header-anchor",href:"#§-29-1-542-importation","aria-label":'Permalink to "§ 29.1-542 Importation."'},"​")],-1),r=e("p",null,"Live wolves or coyotes, or birds and animals otherwise classed as predatory or undesirable, may not be imported into the Commonwealth or liberated therein, or possessed therein, except under a special permit of the Board. Nonpredatory birds, animals or fish may be imported, but upon arrival in the Commonwealth, shall be subject to the laws governing the possession of such birds, animals and fish in Virginia. Any person may bring into the Commonwealth, either in his personal possession or as his baggage, on the same conveyance with him and plainly labeled or tagged with his name and address, game and fish legally taken in another state or foreign country, but in no greater quantity than he could legally possess while in such other state or foreign country. Nothing in this section shall be construed as applying to birds, animals and fish being transported in unbroken packages from beyond the confines of Virginia through the Commonwealth to another state.",-1),h=e("p",null,"Code 1950, § 29-158; 1977, c. 377; 1982, c. 73; 1987, c. 488.",-1),d=[i,r,h];function l(c,m,p,g,u,b){return a(),t("div",null,d)}const y=o(s,[["render",l]]);export{f as __pageData,y as default};
